    bindChangeQuantity: function () {
        var self = this;
        $('body').on('keyup', '.b-quant-inp', function () {

            $pw = $(this).closest('.product_wrapper');
            if (!$pw.length)
                return;

            $input = $(this);
            $pw.find('.quantity_up').fadeIn();
            if ($input.val() == 0) {
                $input.val(1);
                //$pw.find('.b-quant-del').trigger('click');
            }

            if (parseInt($input.val()) > parseInt($input.data('max_quantity'))) {
                $input.val($input.data('max_quantity'));
            }

            if ($input.val() > 1)
                $pw.find('.quantity_down').removeClass('b-disabled');
            else
                $pw.find('.quantity_down').addClass('b-disabled');

            self.updateQuantity($pw.data('id_product'), $input.val());


        });
    },
    bindUpQuantity: function () {
        var self = this;
        $('body').on('click', '.quantity_up', function () {
            $pw = $(this).closest('.product_wrapper');
            $input = $pw.find('input[name=quantity]');
            $input.val(parseInt($input.val()) + 1);

            if (parseInt($input.val()) > parseInt($input.data('max_quantity'))) {
                $input.val($input.data('max_quantity'));
            }

            $pw.find('.quantity_up').fadeIn();
            $pw.find('.quantity_down').removeClass('b-disabled');
            self.updateQuantity($pw.data('id_product'), $input.val());

        });
    },
    bindDownQuantity: function () {
        var self = this;
        $('body').on('click', '.quantity_down', function () {

            if ($(this).hasClass('b-disabled'))
                return;

            $pw = $(this).closest('.product_wrapper');
            $input = $pw.find('input[name=quantity]');
            $input.val(parseInt($input.val()) - 1);
            if ($input.val() == 1) {
                $(this).addClass('b-disabled');
            } else {
                $(this).removeClass('b-disabled');
            }
            self.updateQuantity($pw.data('id_product'), $input.val());


        });
    },
