    addToCart: function (id, quantity, promo_code, callback, services) {
        var self = this;
        var ajax = {
            url: base + '/cart/',
            type: 'post',
            data: 'id_product= ' + id + '&ajax=true&action=add&html=true&quantity=' + quantity + self.orderParams() + '&promo_code=' + promo_code + (services ? '&services=' + services.join(',') : ''),
            dataType: 'json'
        };
        $product = $('.product_wrapper[data-id_product=' + id + ']');
        var name = $('body').attr('id') == 'product' ? $product.find('h1').html() : $product.find('.b-i-product-name a').html();
        if (!name) {
            name = $product.find('.b-name a').html();
        }

        if (typeof fbq !== 'undefined') {
            fbq('track', 'AddToCart', {
                content_name: name, //Название товара
                content_ids: [id], //Идентификаторы добавленных товаров
                content_type: 'product', //константа при добавлении товаров в корзину
                value: $product.attr('data-price'), //Стоимость товара со скидкой
                currency: 'UAH' //Валюта
            });
        }

        customAjax(ajax, function (json) {
            if (typeof callback != 'undefined') {
                callback();
            }
            self.updateEveryWhere(json);

        }, function () {

        });
        return true;
    },
