    privatRecalculate: function () {
        if (!$('select[name=paypart]').length)
            return;


        var monthes = $('select[name=paypart]').val() - 1;

        if ($('.total_delivery').length)
            var total_products = parseInt($('.total_delivery').text().replace(' ', '').replace(' ', ''));
        else
            var total_products = parseInt($('.total_products').text().replace(' ', '').replace(' ', ''));

        if ($('body').attr('id') == 'order') {
            $parent_container = $('select[name=paypart]').closest('.form-group-radio');
        } else {
            $parent_container = $('select[name=paypart]').closest('.credit_row');
        }

        $parent_container.find('input[name="payment_error_9"]').prev('.b-error').remove();
        $parent_container.find('input[name="payment_error_9"]').remove();

        var resCalc = PP_CALCULATOR.calculatePhys(monthes, total_products);
        var overPrice = parseFloat(resCalc.ipValue) * parseFloat(resCalc.payCount) - total_products;


        if (300 < total_products && total_products < 50000) {
            console.log(resCalc);
            $parent_container.find('.privat_error').hide();
            $parent_container.find('.credit_row.privat').removeClass('error');

            $parent_container.find('.credit_row.privat .b-btn-checkout').prop('disabled', false);
            $parent_container.find('.paypart_month b').html(numberWithThousand(parseFloat(resCalc.ipValue).toFixed(2)));
            $parent_container.find('input[name=paypart_first]').val(numberWithThousand(parseFloat(resCalc.ipValue).toFixed(2)));
            $parent_container.find('.paypart_first').html(numberWithThousand(parseFloat(resCalc.ipValue).toFixed(2)));
            $parent_container.find('.paypart_over').html(numberWithThousand(parseFloat(overPrice).toFixed(2)));
        } else {

            if (total_products < 300) {
                $parent_container.find('.privat_error').html(lang['catalog']['Not enought limit']);

            } else {
                $parent_container.find('.privat_error').html(lang['catalog']['Overlimit']);
            }
            $parent_container.find('.privat_error').show();

            $parent_container.find('.credit_row.privat').addClass('error');
            $parent_container.find('.credit_row.privat .b-btn-checkout').prop('disabled', true);
            if ($('input[name="payment"][value="9"]').length > 0 && $('input[name="payment"][value="9"]').is(':checked')) {
                $('input[name="payment"][value="9"]').before('<input name="payment_error_9" type="hidden" class="vRequired">');
            }
            $parent_container.find('.paypart_month b').html('-');
            $parent_container.find('input[name=paypart_first]').val('-');
            $parent_container.find('.paypart_first').html('-');
        }


        $parent_container.find('.paypart_month').show();
    },
    monoRecalculate: function (json) {

        if (!$('select[name=monopaypart]').length)
            return;


        var monthes = parseInt($('select[name=monopaypart]').val());

        if ($('.total_delivery').length)
            var total_products = parseInt($('.total_delivery').text().replace(' ', '').replace(' ', ''));
        else
            var total_products = parseInt($('.total_products').text().replace(' ', '').replace(' ', ''));

        if ($('body').attr('id') == 'order') {
            $parent_container = $('select[name=monopaypart]').closest('.form-group-radio');
        } else {
            $parent_container = $('select[name=monopaypart]').closest('.credit_row');
        }

        $parent_container.find('input[name="payment_error_12"]').prev('.b-error').remove();
        $parent_container.find('input[name="payment_error_12"]').remove();


        if (typeof json.data !== 'undefined' && typeof json.data.max_partial_pay !== 'undefined') {
            if (json.data.max_partial_pay < parseInt($('select[name=monopaypart] option').eq(-1).val())) {
                var options = '';
                for (var i = 3; i <= json.data.max_partial_pay; i++) {
                    options += '<option value="' + i + '" ' + (i == monthes ? ' selected="selected"' : '') + '>' + i + '</option>';
                }
                $('select[name=monopaypart]').html(options);
            }
        }

        var resCalc = total_products / (monthes);//PP_CALCULATOR.calculatePhys(monthes, total_products);

        if (!mono_wrong_phone && 500 < total_products && total_products < 100000 && (typeof json.data === 'undefined' || typeof json.data.bad_partial_products === 'undefined' || !json.data.bad_partial_products)) {

            $parent_container.show();
            $parent_container.find('.privat_error').hide();
            $parent_container.find('.credit_row.privat').removeClass('error');
            $parent_container.find('.credit_row.privat .b-btn-checkout').prop('disabled', false);

            $parent_container.find('.paypart_month b').html(numberWithThousand(parseFloat(resCalc).toFixed(2)));
            $parent_container.find('input[name=paypart_first]').val(numberWithThousand(parseFloat(resCalc).toFixed(2)));
            $parent_container.find('.paypart_first').html(numberWithThousand(parseFloat(resCalc).toFixed(2)));
            $parent_container.find('[name=monopaypart]').prop('disabled', false);
        } else {
            if (!json.data.bad_partial_products) {
                $parent_container.show();
            }

            if (total_products < 500) {
                $parent_container.find('.privat_error').html(lang['catalog']['Not enought limit']);

            } else if (total_products > 100000) {
                $parent_container.find('.privat_error').html(lang['catalog']['Overlimit']);
            } else if (json.data.bad_partial_products) {
                $parent_container.find('.privat_error').html(lang['catalog']['Not monobank products']);
            } else if (mono_wrong_phone) {
                $parent_container.find('.privat_error').html(lang['catalog']['Monobank wrong phone']);
            }

            $parent_container.find('.privat_error').show();

            $parent_container.find('[name=monopaypart]').prop('disabled', true);
            $parent_container.find('.credit_row.privat').addClass('error');
            $parent_container.find('.credit_row.privat .b-btn-checkout').prop('disabled', true);
            if ($('input[name="payment"][value="12"]').length > 0 && $('input[name="payment"][value="12"]').is(':checked')) {
                $('input[name="payment"][value="12"]').before('<input name="payment_error_12" type="hidden" class="vRequired">');
            }
            $parent_container.find('.paypart_month b').html('-');
            $parent_container.find('input[name=paypart_first]').val('-');
            $parent_container.find('paypart_first').html('-');
        }


        $parent_container.find('.paypart_month').show();
    },

