var formData = {
    set: function () {
        var formDataArr = [];// Here we are defining the array of elements
        localStorage.removeItem('formData ');
        $('form input.save_data').each(function () {
//loop through form input fields
            formDataArr.push({name: this.name, value: this.value});
        });
//here we are converting whole array to json
        localStorage.formData = JSON.stringify(formDataArr);
    },

    get: function () {
        if (localStorage.formData != undefined) {
            var formDataArr = JSON.parse(localStorage.formData);
            for (var i = 0; i < formDataArr.length; i++) {
                if ($('[name=' + formDataArr[i].name + ']').hasClass('vPhone'))
                    $('[name=' + formDataArr[i].name + ']').val(formDataArr[i].value.substring(1));
                else
                    $('[name=' + formDataArr[i].name + ']').val(formDataArr[i].value);
            }
        }
    }
}
