var compare = {
    bind: function () {
        this.refresh();
        this.bindAnnounce();
        this.bindAddToCompare();
        this.bindDeleteFromCompare();
        this.bindDeleteCategoryFromCompare();

    },

    bindAnnounce: function () {
        var self = this;
        $('body').on('click', '.add_announce', function () {
            var id = $(this).closest('.product_wrapper').data('id_product');
            self.addAnnounce(id);
        });
    },

    bindAddToCompare: function () {
        var self = this;
        $('body').on('click', '.b-link-add2compare', function (e) {

            if ($(this).hasClass('b-link-add2compare-already-add'))
                return true;

            e.preventDefault();
            var id = $(this).closest('.product_wrapper').data('id_product');
            self.addToCompare(id);
        });
    },
    bindDeleteFromCompare: function () {
        var self = this;

        $('body').on('click', '.compare_delete', function (e) {

            e.preventDefault();
            var id = $(this).closest('.product_wrapper').data('id_product');
            self.deleteFromCompare(id);
        });
    },
    bindDeleteCategoryFromCompare: function () {
        var self = this;
        $('body').on('click', '.compare_delete_category', function (e) {
            e.preventDefault();
            var id = $(this).parent().data('id_category');
            self.deleteCategoryFromCompare(id);
        });
    },

    addToCompare: function (id) {
        var self = this;
        var ajax = {
            url: base + '/compare/',
            type: 'post',
            data: 'ajax=true&action=add&id_product=' + id,
            dataType: 'json'
        };

        customAjax(ajax, function (json) {
            self.updateCompare(json);
        }, function (json) {
            alert(json.errors[0]);
            //errorAjaxForm($("#xx"),json.errors);
        });

    },
    refresh: function (id) {
        var self = this;
        var ajax = {
            url: base + '/compare/',
            type: 'post',
            data: 'ajax=true&action=refresh',
            dataType: 'json'
        };

        customAjax(ajax, function (json) {
            self.updateCompare(json);
        }, function (json) {
            alert(json.errors[0]);
            //errorAjaxForm($("#xx"),json.errors);
        });

    },
    deleteCategoryFromCompare: function (id, callback) {
        var self = this;
        var ajax = {
            url: base + '/compare/',
            type: 'post',
            data: 'ajax=true&action=delete_category&id_category=' + id,
            dataType: 'json'
        };

        customAjax(ajax, function (json) {
            if (typeof callback != 'undefined')
                callback();
            else
                self.updateCompare(json);
            //$('.product_wrapper[data-id_product=' + id + ']').parent().remove();
        }, function (json) {
            //errorAjaxForm($("#xx"),json.errors);
        });
    },

    deleteFromCompare: function (id) {
        var self = this;
        var ajax = {
            url: base + '/compare/',
            type: 'post',
            data: 'ajax=true&action=delete&id_product=' + id,
            dataType: 'json'
        };

        customAjax(ajax, function (json) {
            var $wrapper = $('.product_wrapper[data-id_product=' + id + ']');
            if ($wrapper.attr('data-reload')) {
                str = window.location.href;
                window.location.href = str.replace(id, '');
            } else {
                self.updateCompare(json);
                $wrapper.parent().remove();
            }
        }, function (json) {
            //errorAjaxForm($("#xx"),json.errors);
        });

    },

    updateCompare: function (json) {

        $('.b-link-add2compare:not(.b-link-compare)').removeClass('b-link-add2compare-already-add').html(lang['hardevel_compare']['To compare']).attr('href', 'javascript:void(0);');


        $.each($('.b-cmbx-head'), function (elem) {
            $category = $(this);
            if (!json.data.compare.categories || typeof json.data.compare.categories[parseInt($category.data('id_category'))] == "undefined" || typeof json.data.compare.categories[$category.data('id_category')].count == "undefined") {
                $category.parent().remove();
            } else {
                $category.find('i').html(json.data.compare.categories[$category.data('id_category')].count);
                $('.b-cmbx-btn-compare[data-id_category=' + $category.data('id_category') + ']')
                    .attr('href', json.data.compare.categories[$category.data('id_category')].link)
                    .find('i').html(json.data.compare.categories[$category.data('id_category')].count)

                ;
            }
        });

        if (json.data.compare.ids.length > 0) {
            for (var k in json.data.compare.ids) {
                $product = $('.product_wrapper[data-id_product=' + parseInt(json.data.compare.ids[k]) + ']');
                if ($product.length) {
                    $product.find('.b-link-add2compare:not(.b-link-compare)').addClass('b-link-add2compare-already-add').html(lang['hardevel_compare']['Go to compare'] + ' <i>' + json.data.compare.ids.length + '</i>').attr('href', base + '/compare/');//json.data.compare.link
                    $product.find('.b-link-add2compare.b-link-compare').addClass('b-link-add2compare-already-add').html('<span class="b-ico"></span><span class="b-num">' + json.data.compare.ids.length + '</span>').attr('href', base + '/compare/');//json.data.compare.link
                    $product.find('.b-htconf-btns-list li:first-child').addClass('active');
                }
            }


            $('.b-link-compare .b-num').html(json.data.compare.ids.length);
            $('.b-link-compare').closest('.b-item').addClass('b-active').addClass('active');
            $('.b-hmb-link-compare').closest('li').addClass('b-active');
            $('.b-link-compare').attr('href', base + '/compare/');
            var list = '';
            for (var i in json.data.compare.categories) {
                list += '<li><a href="' + json.data.compare.categories[i].link + '">' + json.data.compare.categories[i].name + ' <i>' + json.data.compare.categories[i].count + '</i></a></li>';
            }
            $('.b-3tcb-popup-list').html(list);
        } else {
            $('.b-link-compare .b-num').html(json.data.compare.ids.length);
            $('.b-link-compare').closest('.b-item').removeClass('b-active');

        }


    },

    addAnnounce: function (id) {

        $popup = $('#popupNotifyAvail');
        $popup.modal();
        $popup.find('#avail_product_id').val(id);

        $("#cNotifyForm").submit(function (e) {
            e.preventDefault();
        }).validate({
            submitHandler: function (form) {
                settings = {
                    url: base + '/',
                    type: 'post',
                    data: $(form).serialize() + '&token=st',
                    dataType: 'json'
                };

                customAjax(settings, function (json) {
                    showPopup($('#popupNotifyAvail'), '', standardMessage(lang['catalog']['Announce availability received'], lang['global']['Thanx']));
                }, function (json) {
                    //errorAjaxForm($("#cEnterForm"),json.errors);
                });

                return false;
            }
        });

    }
};

