function initLazySlider() {
    $('.lazy_mobile_hidden').each(function () {
        if (!isMobile) {
            $(this).lazy({
                defaultImage: lazy_svg,
                afterLoad: function (element) {
                    setTimeout(function (element) {
                        banner(element);
                    }, 100, element);

                }
            });
        }
    });

    $('.b-i-product-pic-slider:visible').not('.ready').each(function () {
        if ($(this).find('.b-i-product-pic-slider-item').length > 1) {
            $(this).after('<div class="b-i-product-pic-slider-cprev"></div><div class="b-i-product-pic-slider-cnext"></div>');
        }
        $(this).find('.b-i-product-pic-slider-item').eq(0).find('.lazy:not(.animation)').lazy({
            afterLoad: function (element) {
                $(element).closest('.lazy_wrapper').addClass('empty');
            }
        });
        $(this).addClass('ready');

        var slide_lazy_function = function (event, opts) {
            $(event.target).find('.cycle-slide-active').find('.lazy:not(.animation)').lazy({
                afterLoad: function (element) {
                    $(element).closest('.lazy_wrapper').addClass('empty');
                }
            });
        };

        $(this).on('cycle-next', slide_lazy_function);
        $(this).on('cycle-prev', slide_lazy_function);

        $(this).cycle({
            prev: $(this).parent().find('.b-i-product-pic-slider-cprev'),
            next: $(this).parent().find('.b-i-product-pic-slider-cnext'),
            slides: ' > div',
            log: false,
            timeout: 1000
        }).cycle('pause');
        $(this).closest('.product_wrapper').mouseover(function () {
            $(this).find('.b-i-product-pic-slider').cycle('resume');
            $(this).find('.lazy:not(.animation)').lazy({
                afterLoad: function (element) {
                    $(element).closest('.lazy_wrapper').addClass('empty');
                }
            });
        });
        $(this).closest('.product_wrapper').mouseout(function () {
            $(this).find('.b-i-product-pic-slider').cycle('pause')
        });

    });

    $('.b-product-db-photos-slider-big').on('init afterChange', function (event, slick, currentSlide, nextSlide) {
        if (!isMobile2) {
            $first = $('.b-product-db-photos-slider-big img').eq(0);
            if (!$first.hasClass('zoomed')) {
                $first.addClass('zoomed').parent().zoom({url: $first.attr('data-big')});
            }
        }
        $('.b-product-db-photos-slider-big').find('.slick-current img').lazy({
            defaultImage: lazy_svg,
            afterLoad: function (element) {
                $(element).closest('.lazy_wrapper').addClass('empty');
                if (!isMobile2 && !$(element).hasClass('zoomed')) {
                    $(element).addClass('zoomed').parent().zoom({url: $(element).attr('data-big')});
                }
            }
        });
    });

}

