$(document).ready(function () {

    var prodScrollOffset = 60;
    if (isMobile3) {
        prodScrollOffset = 20;
    }
    $('.b-btn-add-review').click(function () {
        $('html, body').animate({
            scrollTop: $('#bTabReview .b-tproduct-form').offset().top - prodScrollOffset
        }, 1000);
        return false
    });

    $('.b-btn-ask-a-qst-clc').click(function () {
        $('html, body').animate({
            scrollTop: $('#bTabFaq .b-tproduct-form').offset().top - prodScrollOffset
        }, 1000);
        return false
    });


    $('.b-btn-ask-a-qst-out-tab').click(function () {
        $('.b-reviews-nq-tabs-nav-link-qst').click();
        $('html, body').animate({
            scrollTop: $('#bTabFaq .b-tproduct-form').offset().top - prodScrollOffset
        }, 1000);
        return false
    });

    $('#cAddProductReviewForm').validate();


    $('.b-pfd-loadmore-link').click(function (e) {


        if ($(this).hasClass('load_hidden')) {
            var hrefElem = $(this).attr('data-target');
            if ($(this).hasClass('active')) {
                $(hrefElem).find('.load_hidden_item').hide();
                $(this).removeClass('active');
                $(this).find('span').html($(this).attr('data-show-text'));
            } else {
                $(hrefElem).find('.load_hidden_item').show();
                $(this).addClass('active');
                $(this).find('span').html($(this).attr('data-hide-text'));

            }

            //$(this).parent().remove();
            e.preventDefault();
            return false;
        } else {
            var hrefElem = $(this).attr('href');
            if ($(this).hasClass('active')) {
                $(this).removeClass('active');
                $(hrefElem).animate({height: '200px'}, 300);
                return false
            } else {
                $(this).addClass('active');
                $(hrefElem).animate({height: $(hrefElem)[0].scrollHeight}, 200);
                return false
            }
        }

    });

    /* blackfriday sliders*/
    $('.b-bf-main-pslider').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: true,
        fade: true,
        dots: true,
        appendArrows: $('.b-bf-main-pslider-paging-arrows'),
        appendDots: $('.b-bf-main-pslider-paging')
    });

    $('.b-product-db-photos-slider-bf').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: true,
        fade: true
    });
    /* */

    /* product page big slider */
    $('.b-product-db-photos-slider-big').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: true,
        fade: true,
        asNavFor: '.b-product-db-photos-slider-thumbs'
    });
    $('.b-product-db-photos-slider-thumbs').slick({
        slidesToShow: 5,
        slidesToScroll: 1,
        //variableWidth: false,
        asNavFor: '.b-product-db-photos-slider-big',
        dots: false,
        centerMode: false,
        focusOnSelect: true,
        responsive: [
            {
                breakpoint: 920,
                settings: {
                    slidesToShow: 4
                }
            },
            {
                breakpoint: 720,
                settings: {
                    slidesToShow: 5
                }
            },
            {
                breakpoint: 420,
                settings: {
                    slidesToShow: 4
                }
            }]
    });

    var maxHeight = -1;
    $('.b-product-db-photos-slider-big .slick-slide').each(function () {
        if ($(this).height() > maxHeight) {
            maxHeight = $(this).height();
        }
    });
    $('.b-product-db-photos-slider-big .slick-slide').each(function () {
        if ($(this).height() < maxHeight) {
            $(this).css('margin', Math.ceil((maxHeight - $(this).height()) / 2) + 'px 0');
        }
    });

    if ($('.b-product-db-photos-slider-thumbs .b-item').length === 1) {
        $('.b-product-db-photos-slider-thumbs').addClass('hidden');
    }


    $('.b-product-mob-title').click(function () {
        if (isMobile3) {
            if (!$(this).parent().hasClass('c-active')) {
                $(this).parent().addClass('c-active');
                $(this).parent().find('.b-product-mob-body').stop(true, true).slideDown(200);
                return false;
            } else {
                $(this).parent().removeClass('c-active');
                $(this).parent().find('.b-product-mob-body').stop(true, true).slideUp(100);
                return false;
            }
        } else {
            return false;
        }
    });


    /* custom page scroll header */
    if ($('.b-product-top-side')[0]) {

        onScroll2();
        $(document).on("scroll", onScroll2);

        //smoothscroll
        $('.b-product-sec-nav-list li .b-link').on('click', function (e) {
            e.preventDefault();
            $(document).off("scroll");
            var target = this.hash,
                menu = target,
                specialOffsetTop = $('.b-header-fixedpopup .container-fluid').outerHeight();

            if ($('.b-product-sec-nav-list li').hasClass('active')) {
                $('.b-product-sec-nav-list li').removeClass('active');
            }/*
			else{
				specialOffsetTop = specialOffsetTop - 60
			}*/
            $(this).parent().addClass('active');

            if ($('.b-product-top-side').hasClass('b-product-top-side-specportal')) {
                specialOffsetTop = specialOffsetTop + 30;
            }
            if ((target == '#secProdAll') || (target == '#sec-msi-0')) {
                specialOffsetTop = 0;
            }
            $target = $(target);

            //console.log(specialOffsetTop);
            $('html, body').stop().animate({
                'scrollTop': $target.offset().top - specialOffsetTop
            }, 500, 'swing', function () {
                //window.location.hash = target;
                $(document).on("scroll", onScroll2);
                onScroll2();
            });
        });

        function onScroll2(event) {
            var specialOffsetTop = $('.b-header-fixedpopup .container-fluid').outerHeight();

            var scrollPos = $(document).scrollTop();

            if ($('.b-product-top-side').hasClass('b-product-top-side-specportal')) {
                specialOffsetTop = specialOffsetTop + 30;
            }

            $('.b-header .b-product-sec-nav-list li .b-link').each(function () {
                var currLink = $(this);
                var refElement = $(currLink.attr("href"));
                if (refElement[0]) {
                    if (((refElement.offset().top - specialOffsetTop) <= scrollPos + 1) && ((refElement.offset().top - specialOffsetTop + refElement.outerHeight()) > scrollPos)) {
                        $('.b-header .b-product-sec-nav-list li').removeClass("active");
                        currLink.parent().addClass("active");
                    } else {
                        currLink.parent().removeClass("active");
                    }
                }
            });

            $('.b-header-fixedpopup .b-product-sec-nav-list li .b-link').each(function () {
                var currLink = $(this);
                var refElement = $(currLink.attr("href"));
                if (refElement[0]) {
                    if (((refElement.offset().top - specialOffsetTop) <= scrollPos + 1) && ((refElement.offset().top - specialOffsetTop + refElement.outerHeight()) > scrollPos)) {
                        $('.b-header-fixedpopup .b-product-sec-nav-list li').removeClass("active");
                        currLink.parent().addClass("active");
                    } else {
                        currLink.parent().removeClass("active");
                    }
                }
            });

            var body = $('body'),
                isNavFlying = false;
            var scrollTop = $(document).scrollTop();
            var fullOffset = $('.b-header').outerHeight() - 30;

            if ((scrollTop >= fullOffset) && !isNavFlying && !headerfixCat) {
                isNavFlying = true;
                body.addClass('x-nav-flying-msi');
            } else {
                isNavFlying = false;
                body.removeClass('x-nav-flying-msi x-nav-visible');
            }
        }


    }

    $('.b-header-fixedpopup').hover(function () {
        $('body').addClass('x-nav-visible');
    }, function () {
        $('body').removeClass('x-nav-visible');
    });

});/* product.js */
var id_accessories_category = 0;
var accessories_step = 3;
$(function () {

    $('.selected-component__carousel').slick({
        slidesToShow: 2,
        responsive: [
            {
                breakpoint: 1200,
                settings: {
                    slidesToShow: 2,
                    variableWidth: true
                }
            },
            {
                breakpoint: 768,
                settings: {
                    arrows: false,
                    slidesToShow: 2,
                    variableWidth: true
                }
            },
            {
                breakpoint: 480,
                settings: {
                    arrows: false,
                    slidesToShow: 2,
                    variableWidth: true
                }
            }
        ]
    });

    $.each($('#question_form, .question_form'), function () {
        $(this).validate();
    });

    $('.b-list-likes').on('click', '.red, .green', function () {
        if (!$(this).hasClass('used')) {
            var $wrapper = $(this).closest('.comment_wrapper');

            $wrapper.addClass('used');
            $wrapper.closest('.comment_wrapper').find('.b-link-like,.b-link-dislike').addClass('used');

            //if it hasn't been clicked yet

            var id_comment = $wrapper.data('id_comment');
            ($(this).hasClass('green')) ? type = 'like' : type = 'dislike';
            $.ajax({
                type: "POST",
                data: 'id_comment=' + id_comment + '&type=' + type + '&ajax=true',
                dataType: 'json',
                success: function (message) {
                    count = message.count;
                    if (type == 'like')
                        var cl = 'green';
                    else
                        var cl = 'red';
                    $wrapper.find('.' + cl).html(count);

                }
            });

        }
    });

    $('#idourgather').click(function () {
        $popup = $('#popupBasketAddConfig');
        if ($(this).is(':disabled'))
            return;

        if ($(this).is(':checked')) {
            $popup.find('.b-badd-ctotal .b-price').html(displayPrice($popup.find('.b-cfpm-sp-list').data('total') + $(this).data('price')));
        } else {
            $popup.find('.b-badd-ctotal .b-price').html(displayPrice($popup.find('.b-cfpm-sp-list').data('total')));
        }
    });

    $('#cAddProductReviewForm, #question_form, .question_form').append('<input name="ubot" value="xc" type="hidden"/>');

    $('.b-box-deliv-tabs-nav a[data-toggle="tab"]').on('shown.bs.tab', function (e) {
        var id_city = $(e.target).data('id_city');
        var target = $(e.target).attr("href") // activated tab
        if ($(target).find('.b-shead').length == 0) {
            $.ajax({
                type: "POST",
                data: 'get_delivery=1&id_city=' + id_city + '&ajax=true',
                dataType: 'json',
                success: function (json) {
                    $(target).html(json.data.html);
                }
            });
        }
    });

    $('.b-box-deliv-tabs-nav a.current').tab('show');


    $('.b-relprod-nav a').click(function () {
        $('.b-relprod-nav li').removeClass('active');
        $(this).parent().addClass('active');

        id_accessories_category = $(this).data('id_category');
        $('.accessories .product_wrapper').hide();
        $('.accessories .product_wrapper').parent().hide();

        showAccessories();


    });

    $('.accessories .b-cat-loadmore .b-cat-loadmore-link').click(function () {
        showAccessories();
    });


    if (!isMobile2) {
        $.each($('.b-product-db-photos-slider-big .b-item img'), function () {
            //$(this).parent().zoom({url: $(this).attr('data-big')});
        });
    }

    $('.b-tchb-slider').on('slid.bs.carousel', function () {
        var $current_slide = $('.b-tchb-slider .item.active');
        var $summary_slide = $('.b-item.b-item-summary');
        $summary_slide.find('.b-old-price').html(displayPrice($current_slide.attr('data-bundle_total_old')));
        $summary_slide.find('.b-price').html(displayPrice($current_slide.attr('data-bundle_total')));
        $summary_slide.find('.b-i-product-usave .b-summ').html(displayPrice(parseInt($current_slide.attr('data-bundle_total_old')) - parseInt($current_slide.attr('data-bundle_total'))));
        $summary_slide.find('.b-i-product-usave .b-prc').html(Math.floor(parseInt($current_slide.attr('data-bundle_total')) * 100 / parseInt($current_slide.attr('data-bundle_total_old'))) - 100 + '%');
        $summary_slide.find('.assembly_checkout').attr('data-id_assembly', $current_slide.attr('data-id_assembly'));
        $summary_slide.find('.assembly_checkout').attr('data-promo_codes', $current_slide.attr('data-promo_codes'));
    })


});

function showAccessories() {
    if (id_accessories_category) {
        $all = $('.accessories .product_wrapper[data-id_category="' + id_accessories_category + '"]:hidden');

    } else {
        $all = $('.accessories .product_wrapper:hidden');
    }

    $all.slice(0, accessories_step).show();
    $all.slice(0, accessories_step).parent().show();
    if ($all.length > accessories_step) {
        var load = Math.min(accessories_step, $all.length - accessories_step);
        $('.accessories .b-cat-loadmore span').html(lang['global']['load more'] + ' <b>' + load + '</b> ' + declOfNum(load, lang['global']['products decl arr']));
        $('.accessories .b-cat-loadmore').show();
    } else {
        $('.accessories .b-cat-loadmore').hide();
    }
    initLazySlider();
}

